        <div className="container">
            <div className="child row">
                <div className="setitems">
                    <div className="inl">
                        <img className="imgset" src={getStatic("/index.png")}/>
                    </div>
                    <div className="inl">
                        <span>
                            Instagram
                        </span>
                    </div>
                    <div className="inl">
                        <input 
                            className="input is-warning is-small is-rounded" 
