                            onKeyDown={this.getinputdata} 
                            placeholder="search" 
                            id="input"
                        />
                    </div>
                    <div className="inl">
                        <Link to="/profile">
                            <img className="imgset" src={getStatic("/images.png")} />
                        </Link>
                    </div>
